$('.map').mousemove(function(e) {
	var parentOffset = $(this).offset(); 
	var mouseX = e.pageX - parentOffset.left;
	var mouseY = e.pageY - parentOffset.top;

	$('.info_panel').css({
		top: mouseY + 30,
		left: mouseX - ($('.info_panel').width()/2) - 10
  });
});

